import Logow from "../images/logow.png"
import Xpic from "../images/x.png"

export default function Menu(){
    return(
        <div className="h-[100vh] w-[100vw] bg-black ">
            <div>
                <img src={Logow}></img>
                <img src={Xpic}></img>
            </div>

        </div>
    )
}
